INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "お！\nあそこに困ってそうな人発見！", "春咲 ひより", 1, 1, 0, 0, 2, 0, "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 1, 1.4, 1001);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "わ、わたし、\nなに言ってるんだろ\nあはは…", "大切な人を\n守れるようになりたい…って", "草野 優衣", 1, 1, 0, 0, 2, 0, "みんなみたいに\nわたしも強くならなきゃ", 1, 1.4, 1002);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "少しは磨かれると思いますよ。", "キミに必要な集中力と感性が", "士条 怜", 1, 1, 0, 0, 2, 0, "フェンシングを始めてみては？", 1, 1.4, 1003);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "みそぎはねぇ、\nかくれんぼやりたい！", "今日はなにして遊ぶ？", "穂高 みそぎ", 1, 1, 0, 0, 2, 0, "ねぇ、にいちゃん！", 1, 1.5, 1004);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "私といっしょに…\nいかない？", "ねぇ…", "風宮 あかり", 1, 1, 0, 0, 2, 0, "風宮あかりです", 1, 1.4, 1006);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "食べ物の恨みは怖いのー", "プリンたべたいのー", "出雲 宮子", 1, 1, 0, 0, 2, 0, "出雲宮子なのー", 1, 1.5, 1007);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "いいよ。\n見られることは運命さ…", "キミもボクの美貌に\n吸い寄せられたんだね。", "虹村 雪", 1, 1, 0, 0, 2, 0, "ボクは虹村雪。", 1, 1.4, 1008);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "人呼んで「疾風の冥姫」!!", "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "柊杏奈", 1, 1, 0, 0, 2, 0, "フッ…聞いて後悔するがいい！", 1, 1.4, 1009);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "ほんまおおきにやわ～♪", "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "姫宮 真歩", 1, 1, 0, 0, 2, 0, "マホマホ王国のプリンセス、\nまほ姫どす", 1, 1.5, 1010);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "ここで会ったが\n100年目～！", "生き別れたお兄ちゃんを探して\n三千世界！", "衣之咲 璃乃", 1, 1, 0, 0, 2, 0, "衣之咲璃乃です！", 1, 1.4, 1011);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "…って、お願い！\n誰にも言わないでおいて～！", "ち、超能力って…\n何のことかな～？", "柏崎 初音", 1, 1, 0, 0, 2, 0, "私はハツネ、\n結構強いんだよ。\nきらーん☆", 1, 1.4, 1012);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "一応カリスマ読モJKやってまっす！", "美波 鈴奈", 1, 1, 0, 0, 2, 0, "ちょす！\n美波鈴奈だよ～♪", 1, 1.4, 1016);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "でも、沖縄もとってもいいとこさー", "東京は遊園地みたいなところさー", "喜屋武 香織", 1, 1, 0, 0, 2, 0, "はいたーい。\n喜屋武香織さー。", 1, 1.4, 1017);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "イオちゃんって呼んでね。", "先生って呼ばれるのは\nくすぐったいから", "支倉 伊緒", 1, 1, 0, 0, 2, 0, "支倉伊緒です。", 1, 1.4, 1018);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "ミミをおいてかないでぇ～", "あ！/\お兄ちゃ～ん\nまってよ～", "茜 ミミ", 1, 1, 0, 0, 2, 0, "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 1, 1.5, 1020);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "ふぇぇぇぇぇん……", "あの……\nふぇ……", "栗林 くるみ", 1, 1, 0, 0, 2, 0, "あ…あの…えっと…\n栗…林…くるみ…です……", 1, 1.5, 1021);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "なんてありがとうございます！", "こんな私に貴重な時間を\n割いていただき、", "風宮 より", 1, 1, 0, 0, 2, 0, "風宮よりです。\nあああああ！", 1, 1.4, 1022);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "私こっち行きたいー\nね、早く早くー", "おにいちゃんどこいくの？\nえ？", "北条 綾音", 1, 1, 0, 0, 2, 0, "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 1, 1.5, 1023);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "これて何か違う…\nあああすみません！", "ふ、不束者ですが\nどうぞ末永く…って、", "天野 すずめ", 1, 1, 0, 0, 2, 0, "わっ…わっ…私、\n天野すずめといいます！", 1, 1.4, 1025);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "離しませんわ………\n絶対に…!!", "あなたは…運命の……\n伴侶……", "倉石 恵理子", 1, 1, 0, 0, 2, 0, "……クスクス…私は\n…倉石恵理子……", 1, 1.4, 1027);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "…そうでしょ？？", "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "佐々木 咲恋", 1, 1, 0, 0, 2, 0, "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 1, 1.4, 1028);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "あはは、\n私もまだまだだなぁ～", "ぇっと…\nキミ、私のこと知らないの?!", "桜井 望", 1, 1, 0, 0, 2, 0, "桜井望だよ！\nよろしくねっ", 1, 1.4, 1029);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "ショーグン、\nワタシと一緒に天下統一デース！", "初めまして、\n私はニノン・ジュベール申すデス！", "ニノン・ジュベール", 1, 1, 0, 0, 2, 0, "デケデケデンっ！", 1, 1.4, 1030);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "おかしいですね……", "でもって私の隣にいるのが……\nえ、見えない？", "上喜 しのぶ", 1, 1, 0, 0, 2, 0, "上喜しのぶです。\n手元のドクロが父です。", 1, 1.4, 1031);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "そう、\nオラのボケに突っ込める相方が…！", "けんども\nそれには足りないモンが…", "野戸まひる", 1, 1, 0, 0, 2, 0, "目指すはビッグな\nお笑い芸人だっぺ！", 1, 1.5, 1033);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "ちょ\nちょっと一杯飲んできます…！", "ちょっと緊張しちゃって…", "綾瀬 ゆかり", 1, 1, 0, 0, 2, 0, "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 1, 1.4, 1034);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "これ以上お話しすることは…\nないです！", "知らない人とは話しちゃいけないので", "氷川 鏡華", 1, 1, 0, 0, 2, 0, "氷川鏡華…です", 1, 1.5, 1036);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "……あ、アラーム。", "柏崎 栞", 1, 1, 0, 0, 2, 0, "柏崎…栞です。", 1, 1.4, 1038);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "野に咲く花が、\n唯一の話相手です。", "私、一人も友達がいなくて……", "双葉 碧", 1, 1, 0, 0, 2, 0, "ふ、双葉碧です。", 1, 1.4, 1040);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "そう思っています。", "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "三角 千歌", 1, 1, 0, 0, 2, 0, "三角千歌です。", 1, 1.4, 1042);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "う、疑ってすまなかったな…", "あぁ？\nお前のそいつの仲間か？", "安芸 真琴", 1, 1, 0, 0, 2, 0, "安芸真琴だ。", 1, 1.4, 1043);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "生けとし生ける全ての者よ！", "イリヤ・オーンスタイン", 1, 1, 0, 0, 2, 0, "わらわこそは夜を総べる者！", 1, 1.4, 1044);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "ｌク、クウカに何かご用ですか!?", "ぐふふふふ……はっ！", "遠見 空花", 1, 1, 0, 0, 2, 0, "そこで騎士は妖精を乱暴に……", 1, 1.4, 1045);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "う～ん…\n猫ってホントに最高にゃ～♪", "自由気ままで♪\n寝て遊んで、食べてケンカして…", "宮坂たまき", 1, 1, 0, 0, 2, 0, "宮坂たまきにゃ♪\n猫はいいにゃよ？", 1, 1.4, 1046);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "…と思ったら\nバイトの時間だ！\nまたあとでね！", "それでは早速クエストに…", "大神 美冬", 1, 1, 0, 0, 2, 0, "大神美冬よ！", 1, 1.4, 1048);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "クエストもバトルも\n掃除も洗濯も", "星野静流", 1, 1, 0, 0, 2, 0, "星野静流だよ！", 1, 1.4, 1049);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "見ての通りの\nセクシー美少女で", "玉泉美咲", 1, 1, 0, 0, 2, 0, "アタシは玉泉美咲。", 1, 1.5, 1050);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "？？？？", "？？？？", "リマ", 1, 1, 0, 0, 2, 0, "？？？", 1, 1.4, 1052);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", "モニカ・ヴァイスヴィント", 1, 1, 0, 0, 2, 0, "モニカ・ヴァイスヴィントだ。", 1, 1.5, 1053);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", "ペコリーヌ", 1, 1, 0, 0, 2, 0, "モニカ・ヴァイスヴィントだ。", 1, 1.5, 1058);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", "コッコロ", 1, 1, 0, 0, 2, 0, "モニカ・ヴァイスヴィントだ。", 1, 1.5, 1059);
INSERT INTO `v1_6a055a64d513612d0b1b258b939310e186d90752f9b72984c022c4050c6bc138` VALUES (0, 0, "そ、そこまでいうなら\nもらってやる", "菓子でつろうなどと\n稚拙な策を……", "キャル", 1, 1, 0, 0, 2, 0, "モニカ・ヴァイスヴィントだ。", 1, 1.5, 1060);
